  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Accueil name="le monde" />} />
          <Route path='/compteur' element={<Compteur />} />
          <Route path='/about' element={<About />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App;
